                                data: [{
                                    name: '一倍标准差',
                                    xAxis: this.standarDevRangeOfOne.low.toFixed(),
                                    // 当 n 倍标准差在坐标轴外时，将其隐藏，否则它会默认显示在最小值部分，容易引起混淆
                                    lineStyle: {
                                        opacity: (this.min > this.standarDevRangeOfOne
                                            .low) ? 0 : 1
                                    },
                                    label: {
                                        show: !(this.min > this.standarDevRangeOfOne.low)
                                    }
                                }, {
                                    name: '一倍标准差',
                                    xAxis: this.standarDevRangeOfOne.up.toFixed(),
                                    lineStyle: {
                                        opacity: (this.max < this.standarDevRangeOfOne.up) ?
                                            0 : 1
                                    },
                                    label: {
                                        show: !(this.max < this.standarDevRangeOfOne.up)
                                    }
                                }, {
                                    name: '二倍标准差',
                                    xAxis: this.standarDevRangeOfTwo.low.toFixed(),
                                    lineStyle: {
                                        opacity: (this.min > this.standarDevRangeOfTwo
                                            .low) ? 0 : 1
                                    },
                                    label: {
                                        show: !(this.min > this.standarDevRangeOfTwo.low)
                                    }
                                }, {
                                    name: '二倍标准差',
                                    xAxis: this.standarDevRangeOfTwo.up.toFixed(),
                                    lineStyle: {
                                        opacity: (this.max < this.standarDevRangeOfTwo
                                            .up) ? 0 : 1
                                    },
                                    label: {
                                        show: !(this.max < this.standarDevRangeOfTwo.up)
                                    }
                                }, {
                                    name: '三倍标准差',
                                    xAxis: this.standarDevRangeOfThree.low.toFixed(),
                                    lineStyle: {
                                        opacity: (this.min > this.standarDevRangeOfThree
                                            .low) ? 0 : 1
                                    },
                                    label: {
                                        show: !(this.min > this.standarDevRangeOfThree.low)
                                    }
                                }, {
                                    name: '三倍标准差',
                                    xAxis: this.standarDevRangeOfThree.up.toFixed(),
                                    lineStyle: {
                                        opacity: (this.max < this.standarDevRangeOfThree
                                            .up) ? 0 : 1
                                    },
                                    label: {
                                        show: !(this.max < this.standarDevRangeOfThree.up)
                                    }
                                }, {
                                    //name: '平均值',
                                    type: 'average',
                                    xAxis: this.average.toFixed(),
                                    lineStyle: {
                                        color: 'red'
                                    }
                                }, ]
                            }
                        }],
                        title: {
                            text: '均价:'+(this.sum / this.data.length).toFixed(0)+'  ₩',
                            top: '85%',
                            left: '6%',
                            textStyle: {
                                color: '#778899',
                                weight:400,
                                size:100
                            }
                        },

                    }
 
                    this.chart.setOption(options)
                    window.addEventListener("resize", () => {
                        this.chart.resize()
                    })
                },
      }


    }
    







</script>

